import { IonBackButton, IonButtons, IonHeader, IonPage, IonTitle, IonToolbar, useIonViewWillEnter } from "@ionic/react";
import React from "react";
import { useHistory } from "react-router";

const NewPassword: React.FC = () => {
const path = useHistory();

useIonViewWillEnter(() => {
    document.addEventListener('backbutton', (ev: any) => {
      path.replace('/login')
    });
})
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar color="primary">
            <IonButtons>
            <IonBackButton />
            </IonButtons>
          <IonTitle>New Password </IonTitle>
        </IonToolbar>
      </IonHeader>
    </IonPage>
  );
};

export default NewPassword;
